def transform(sequence):
    leading_zeros = 0
    trailing_zeros = 0
    for i in range(len(sequence)):
        if sequence[i] == '0':
            leading_zeros += 1
        else:
            break
    for i in range(1, len(sequence) + 1):
        if sequence[-i] == '0':
            trailing_zeros += 1
        else:
            break
    transformed_sequence = '0' * leading_zeros + sequence[leading_zeros:-trailing_zeros].lstrip('0') + '0' * trailing_zeros
    return transformed_sequence
